import React from 'react'

const SkeletonLoading = () => {
  return (
    <div className="grid-item">
        <div className="skeleton skeleton-grid-item">
        </div>
        <h1 className='skeleton skeleton-text'>Meow</h1>
    </div>
  )
}

export default SkeletonLoading
